// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;
import '../library/Report.sol';
import '../token/DefenderToken.sol';
import '../library/Queue.sol';
import '../library/ObjStruct.sol';

contract DataStorage{

    DefenderToken public token;
    mapping (address => ObjStruct.Inspector) inspectors;
    mapping (address => ObjStruct.Platform) platforms;
    mapping (bytes32 => ObjStruct.Defendee) defendees;
    
    mapping (address => ObjStruct.Blower) blowers;
    mapping (bytes => Report.link) reports;
    mapping (bytes32 => Queue) readyJudgeQueue;

    Queue compenSationQueue;
    address payable representor;

    uint16 constant public MAX_RATE_INSPECT = 65535;
    uint16 constant public MIN_RATE_INSPECT = 10000;
    uint16 constant public MAX_RATE_PLATFORM = 65535;
    uint16 constant public MIN_RATE_PLATFORM = 10000;
}
